        "url:layercake/templates/HelpDialog.html": "<div>\n  <div data-dojo-type=\"dijit/Dialog\"\n      data-dojo-attach-point=\"dialog\"\n      data-dojo-props=\"title: 'Virology Information'\">\n    <p>Welcome to the Virology visualization of T-BioInfo platform.</p>\n    <p>The original inspiration for this visualization is the MIT licensed Layercake from UW, for more information see <a href=\"http://graphics.cs.wisc.edu/WP/layercake/\">this link</a>.</p>\n    <b>Introduction</b>\n    <p>This tool is created to visualize the variations that occur with RNA viruses using both CirSeq and NGS data sets. This includes the genome variations, amino acid variations, and even protein structure changes allowing for a full picture to be brought to the researcher.</p>\n    <b>T-BioInfo and Viral Visualization</b>\n    <p>The T-BioInfo platform is a flexible and user-friendly bioinformatics computational system that provides intuitive and user-friendly interface for building pipelines. The virology pipeline, is specially designed for both Cirseq and regular NGS data sets. Building a pipeline within the platform will allow for the user to add a visualization step and thus get an output along with their excel file for a visual representation of their data output.</p>\n    <b>CirSeq</b>\n    <p>Circular Sequencing, when circularized genomic RNA fragments are used to generate tandem repeats that serve as substrates for next-generation sequencing. This allows for mutation frequencies to be seen and give a more accurate distribution of mutant frequencies within RNA virus populations. This combined with our visualization method allows for a very clear picture of the mutation rates and fitness of RNA viruses.</p>\n    <b>NGS</b>\n    <p>To use the visualization, notice four main sections: The menu on top, allowing one to change the bin size or the number of nucleotides present within a bin, the Rate of Mutation visualized, the Fitness type if a fitness job was performed, and the type of mutation (synonymous or nonsynonymous). There is also the proteins area, showing the protein layout in a tiered format, first showing the poly-protein in the order of proteins from the 5’UTR to the 3’UTR, second and third tiers show the auto-cleavage that results in a number of subsequent individual viral proteins.</p>\n    <p>These individual viral proteins are thus interactive, selecting a single protein will result in a pop-up box that will show the nucleotide and amino acid regions pertaining specifically to that protein and additionally, if the structure is publicly available, it will also be modeled for the user.</p>\n    <p>The coloring of these protein structures can change due to the mutations that occur within the nucleotide codon that results in changes of the amino acids. The purpose of the visualization is to assist the virologist in identifying the significant mutations within their experimentation.</p>\n  </div>\n</div>\n",
